import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation, Autoplay } from "swiper/modules";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/autoplay";

const Main = () => {
    return (
        <div className="main">
            {/* Баннер с Swiper */}
            <div className="banner">
                <Swiper
                    modules={[Navigation, Autoplay]}
                    navigation
                    autoplay={{ delay: 3000 }}  // Исправлено: autopaly → autoplay, dealy → delay
                    loop={true}
                    className="banner-swiper"
                >
                    <SwiperSlide>
                        <img src="/img/banner/banner.jpg" alt="Description" className="slide-image" />
                    </SwiperSlide>
                    <SwiperSlide>
                        <div className="slide-content">Слайд 2</div>
                    </SwiperSlide>
                    <SwiperSlide>
                        <div className="slide-content">Слайд 3</div>
                    </SwiperSlide>
                </Swiper>
            </div>

            {/* Каталог */}
            <div className="catalog_c">Каталог</div>
            <div className="card-catalog">
                <div className="card_photo">
                    <div className="card_title">  {/* Исправлено: card_titile → card_title */}
                    </div>
                </div>
            </div>
        </div> // Закрывающий тег для .main
    );
}

export default Main;
